window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"17.1.1","implementation":{"name":"cucumber-jvm","version":"7.2.3"},"runtime":{"name":"OpenJDK 64-Bit Server VM","version":"17.0.1+12"},"os":{"name":"Windows 10"},"cpu":{"name":"amd64"}}},{"testRunStarted":{"timestamp":{"seconds":1653379382,"nanos":636705100}}},{"source":{"uri":"classpath:stories/OrdersAndShipmentsEndToEndFlows.feature","data":"@OrderAndShipmentAll\r\nFeature: Shipment Module\r\n  As a user I should able to do shipment of orders.\r\n\r\nBackground: Set Story test data file name and story data node\r\n\t\t\tGiven storyDataFileName \"OrdersAndShipmentsTestData\" and storyDataNode \"OrdersAndShipmentsData\"\r\n  \t\r\n@OrderShipmentScenario1\r\n@OrderShipmentScenario\r\nScenario Outline: Scenario1\r\nGiven user read scenariodata \"<ScenarioData>\"\r\nAnd user launch the browser and naviagte to vaccineledger site\r\nWhen login with central authority user into the application\r\nAnd user navigate to orders tab and create new order with given details \"OrderDetails\"\r\nThen user logout from application\r\nWhen login with vendor user into the application\r\nAnd user navigate to Orders Received tab and accepts the order\r\nThen user logout from application\r\nExamples:\r\n|ScenarioData|\r\n|Scenario    |\r\n  \t\r\n@OrderShipmentScenario2\r\n@OrderShipmentScenario\r\nScenario Outline: Scenario2\r\nGiven user read scenariodata \"<ScenarioData>\"\r\nAnd user launch the browser and naviagte to vaccineledger site\r\nWhen login with central authority user into the application\r\nAnd user navigate to orders tab and create new order with given details \"OrderDetails\"\r\nThen user logout from application\r\nWhen login with vendor user into the application\r\nAnd user navigate to Orders Received tab and rejects the order\r\nThen user logout from application\r\nExamples:\r\n|ScenarioData|\r\n|Scenario    |\r\n\r\n@OrderShipmentScenario3\r\nScenario Outline: Scenario3\r\nGiven user read scenariodata \"<ScenarioData>\"\r\nAnd user launch the browser and naviagte to vaccineledger site\r\nWhen login with central authority user into the application\r\nAnd user navigate to orders tab and create new order with given details \"OrderDetails\"\r\nAnd user navigate to Orders Sent tab and cancels the order\r\nThen user logout from application\r\nExamples:\r\n|ScenarioData|\r\n|Scenario    |\r\n  \t\r\n@OrderShipmentScenario4\r\nScenario Outline: Scenario4 - create shipment- with ref id previuos shipment id is pending\r\nGiven user read scenariodata \"<ScenarioData>\"\r\nAnd user launch the browser and naviagte to vaccineledger site\r\nWhen login with central authority user into the application\r\nAnd user navigate to orders tab and create new order with given details \"OrderDetails\"\r\nThen user logout from application\r\nWhen login with vendor user into the application\r\nAnd user navigate to Orders Received tab and accepts the order\r\nAnd user navigate to shipments tab and create new shipment with given details \"ShipmentDetails\"\r\nThen user logout from application\r\nWhen login with consignee user into the application\r\nAnd user navigate to Inbound tab and receive shipment with quantity \"100\"\r\nThen user logout from application\r\nWhen login with vendor user into the application\r\nAnd user navigate to shipments tab and create new shipment with reference id & given details \"ShipmentDetails2\"\r\nThen user logout from application\r\nWhen login with consignee user into the application\r\nAnd user navigate to Inbound tab and receive shipment with quantity \"50\"\r\nThen user logout from application\r\nExamples:\r\n|ScenarioData|\r\n|Scenario    |\r\n\r\n@OrderShipmentScenario5\r\nScenario Outline: Scenario5  - update shipment status\r\nGiven user read scenariodata \"<ScenarioData>\"\r\nAnd user launch the browser and naviagte to vaccineledger site\r\nWhen login with central authority user into the application\r\nAnd user navigate to orders tab and create new order with given details \"OrderDetails\"\r\nThen user logout from application\r\nWhen login with vendor user into the application\r\nAnd user navigate to Orders Received tab and accepts the order\r\nAnd user navigate to shipments tab and create new shipment with given details \"ShipmentDetails\"\r\nThen user logout from application\r\nWhen login with consignee user into the application\r\nAnd user navigate to Inbound tab and receive shipment with quantity \"100\"\r\nThen user logout from application\r\nWhen login with consignee user into the application\r\nAnd user navigate to Inbound tab and update the shipment with given details \"updateShipmentDetails\"\r\nThen user logout from application\r\nExamples:\r\n|ScenarioData|\r\n|Scenario    |\r\n\r\n@OrderShipmentScenario6\r\nScenario Outline: Scenario6 - Partial quantity\r\nGiven user read scenariodata \"<ScenarioData>\"\r\nAnd user launch the browser and naviagte to vaccineledger site\r\nWhen login with central authority user into the application\r\nAnd user navigate to orders tab and create new order with given details \"OrderDetails\"\r\nThen user logout from application\r\nWhen login with vendor user into the application\r\nAnd user navigate to Orders Received tab and accepts the order\r\nAnd user navigate to shipments tab and create new shipment with given details \"ShipmentDetails\"\r\nThen user logout from application\r\nWhen login with consignee user into the application\r\nAnd user navigate to Inbound tab and receive shipment with quantity \"50\"\r\nThen user logout from application\r\nExamples:\r\n|ScenarioData|\r\n|Scenario    |","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:stories/OrdersAndShipmentsEndToEndFlows.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@OrderAndShipmentAll","id":"4d8f67c4-402e-43b5-9d57-922fec977bf1"}],"language":"en","keyword":"Feature","name":"Shipment Module","description":"  As a user I should able to
